%YAML 1.2
#Dictionary extension for En-VCCV voicebanks
#Japanese (Hiragana, Katakana, romaji), Korean (Hangul, Romaja), Chinese Pinyin, Cantonese Jyutping, French and Spanish are currently supported.
#More languages to support soon.
#This dictionary is being updated regularly so download the latest one here:
#https://github.com/Cadlaxa/Openutau-Yaml-Dictionaries.git
#Mirror link:
#https://mega.nz/folder/BjhATYZb#s3dYIDZxlBRG7TF0QBG6Xw

#Merged Halo/BagelHero & Mim's lyric parser dictionary

#phoneme [ao] is converted as [9], if the vb has problems on the pronunciation, change it to [0]
#steps in changing a phoneme: use notepad, find this types of config (X = will be your phoneme here)
#and type the configs without the parenthesis on find then, replace it with your desired phoneme
#([X,) (, X,) (,X])

#phoneme [q] or glottal stop on arpasing might be an issue to the vb, inputs such as [jjy e] have
#glottal input (q, j, y, e), manually type the desired phoneme on OU then lengthen the VC/CC to emulate a stop/glottal
---
symbols:
#CZsampa standard vowels
  - {symbol: '@', type: vowel}
  - {symbol: a, type: vowel}
  - {symbol: i, type: vowel}
  - {symbol: u, type: vowel}
  - {symbol: e, type: vowel}
  - {symbol: o, type: vowel}
  - {symbol: A, type: vowel}
  - {symbol: I, type: vowel}
  - {symbol: E, type: vowel}
  - {symbol: O, type: vowel}
  - {symbol: 0, type: vowel}
  - {symbol: 3, type: vowel}
  - {symbol: 6, type: vowel}
  - {symbol: 8, type: vowel}
  - {symbol: Q, type: vowel}
  - {symbol: h, type: aspirate}
  - {symbol: j, type: affricate}
#Arpasing
  - {symbol: aa, type: vowel}
  - {symbol: ae, type: vowel}
  - {symbol: ah, type: vowel}
  - {symbol: ao, type: vowel}
  - {symbol: aw, type: vowel}
  - {symbol: ay, type: vowel}
  - {symbol: b, type: stop}
